import React from 'react';
import { Box, Typography, makeStyles }
  from '@material-ui/core';
import NavBar from './components/navBar/index';
import BGImage from './images/arif-wahid-y3FkHW1cyBE-unsplash.png';


const useStyles = makeStyles(theme => ({
  root: {
    height: '100vh',
    flexGrow: 1,
    // backgroundColor: theme.palette.secondary.main,
    // backgroundImage: `url(${BGImage})`,
    backgroundSize: 'cover',
    overflow: 'hidden',
    backgroundRepeat: 'no-repeat',
    backgroundPosition: 'center',
  },
  menuButton: {
    marginRight: theme.spacing(2),
  },
  title: {
    marginTop: '100px',
    display: "flex",
    justifyContent: "center",
    color: 'white'
  },
  textBox: {
    display: 'flex',
    alignItems: 'center'
  },
  test: {
    boxShadow: 'rgb(194, 223, 235) -10px -10px 16px 0px, rgb(122, 167, 205) 10px 10px 16px 0px, rgb(194, 223, 235) 2px 2px 4px 0px inset, rgb(122, 167, 205) -2px -2px 4px 0px inset',
    backgroundColor: 'rgb(179, 210, 230)'
  }
}));

const App = () => {
  const classes = useStyles();
  const [bgColor, setBgColor] = React.useState('#B3D2E6');

  return (
    <Box >
      <NavBar />
      <Box
        p={5}
        className={classes.root}
        bgcolor={bgColor}
        width={'100%'}
        // height={'100%'}
        display={'flex'}
        justifyContent={'center'}
        alignItems={'center'}
        flex={1}
      >
        <Box className={classes.test} borderRadius={16} width={340} height={260} />
      </Box>
    </Box>
  );
}

export default App;
